import React from 'react';
import SoundTile from './src/SoundTile';

const HomePage = () => {
  return (
    <div className="page" style={{ backgroundColor: 'lightblue', height: '100vh' }}>
      <SoundTile sound="Fan" />
      <SoundTile sound="Cat" />
      <SoundTile sound="Clock" />
      <SoundTile sound="Rain on Window" />
      <SoundTile sound="Washing Machine" />
    </div>
  );
};

export default HomePage;
